import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const heading = {
  fontFamily: '"Roboto", sans-serif',
  fontWeight: "bolder",
  color: "black",
  fontSize: "1000%",
  textAlign: "center",
  margin: "400px 0",
};

const bam = {};

let curDate = new Date();
curDate = curDate.getHours();
let greeting = "";

if (curDate >= 1 && curDate < 12) {
  greeting = "Good Morning";
  bam.color = "green";
} else if (curDate >= 12 && curDate < 19) {
  greeting = "Good AfterNoon";
  bam.color = "Red";
} else {
  greeting = "Good Night";
  bam.color = "black";
}

ReactDOM.render(
  <>
    <h1 style={heading}>
      {" "}
      Hello Sir, <span style={bam}>{curDate}</span>{" "}
    </h1>
    , document.getElementById("root")
  </>
);
